import './Plant.css'

function Plant(props) {
    const month = props.firstWater.toLocaleString('en', {month: 'long'})
    const day = props.firstWater.toLocaleString('en', {day: '2-digit '})
    const year = props.firstWater.getFullYear()

    return (
        <div className="individual-plant">
        <div>{day}</div>
            <div>{month}</div>
            <div>{year}</div>
            <div className="plant-info">
            <h2>{props.name}</h2>
            <div className="water-frequency">{props.frequency}</div>
            </div>
        </div>
    );

}

export default Plant;
